import React from 'react';
import styled from 'styled-components';
import arena_01 from '../../../assets/arena_01.jpeg';

function Overworld() {
  return (
    <Wrapper>
      <h3>Da World</h3>
      <img src={arena_01} alt='arena' />
    </Wrapper>
  );
}

const Wrapper = styled.div`
  border: 1px solid green;
  border-radius: 8px;
`;

export default Overworld;
